import Post from "../Post/Post";
import "./Posts.css";

export default function Posts() {
  return (
    <div className="posts">
        <h1>Recent Posts</h1>
      <Post img="https://theredstockingschronicleblog.wordpress.com/wp-content/uploads/2020/03/2628e9cef2caa85b75cd4ba02e11bfae.jpg?w=640" />
      
    </div>
  );
}
